                nuevaFecha.setMinutes(nuevaFecha.getMinutes() + i);
                // genera un numero random que sera el numero de cjas por hora
                cajas += Math.round((Math.random() < 0.5 ? 1 : -1) * Math.random() * 10);
                // agrega los datos a un arreglo
                chartData.push({
                    fecha: nuevaFecha,
